import React, { Component } from 'react'
import { Link } from 'react-router-dom'

export default class MainPage extends Component {
    render() {
        return (
            <div id='MainPage'>
                <h2>Life</h2>
                <Link className="link btn">Create new account!</Link>
            </div>
        )
    }
}
